import { handlerService } from "./handlerService";

const VueJiraHandler = {
    install: (Vue, { opts }) => {
        handlerService.initHandler(opts)
        Vue.config.errorHandler = (err, vm, info) => handlerService.onError(err);         
    }
}

export { VueJiraHandler }
